import CardListContainer from './indivCards'
import {Container} from 'react-bootstrap';

import '../App.css';

class App extends Component {
    render() {
        return (

            <div className="App">
                <HeroHeader/>
                <CardListContainer/>


            </div>

        );
    }
}

export default App;


class HeroHeader extends Component {
    render() {
        return (
            <div>
                {/*https://codepen.io/diegopardo/pen/GqEho*/}
